import './HeroSection.css';
import '../App.css';

function AboutUs() {
  return (
    <div className='hero-container'>
      <div className='video-wrapper'>
        <video src='./videos/Demoday.mp4' autoPlay loop muted className='fixed-video' />
      </div>
    </div>
  );
}

export default AboutUs;
